import UIKit

import Foundation
#if canImport(FoundationNetworking)
import FoundationNetworking
#endif

class SwiftTest: UIViewController {

    override func viewDidLoad() {
        super.viewDidLoad()

        // Do any additional setup after loading the view.
    }
    

    /*
    // MARK: - Navigation

    // In a storyboard-based application, you will often want to do a little preparation before navigation
    override func prepare(for segue: UIStoryboardSegue, sender: Any?) {
        // Get the new view controller using segue.destination.
        // Pass the selected object to the new view controller.
    }
    */

    @IBAction func clickButton(_ sender: UIButton) {
        
        var semaphore = DispatchSemaphore (value: 0)

        //[1]    (null)    @"focalLength" : @"1641.271,1641.271"
        //[2]    (null)    @"principalPoint" : @"948.8137,719.0298"
        let parameters = [
          [
            "key": "data",
            "value": "{\"timestamp\":\"11111111630393036\",\"intrinsic\":\"[1641.271, 1641.271, 948.8137, 719.0298]\",\"distortion\":\"[0.0, 0.0, 0.0, 0.0]\",\"prior_translation\":\"{\\\"alt\\\":10.0,\\\"lat\\\":31.17940571727986,\\\"lon\\\":121.60382399757607}\",\"prior_rotation\":\"{x=0, y=0, z=0, w=1}\"}",
            "type": "text"
          ],
          [
            "key": "image",
            "value": "",
            "type": "text"
          ]] as [[String : Any]]

        let boundary = "Boundary-\(UUID().uuidString)"
        var body = ""
        var error: Error? = nil
        for param in parameters {
          if param["disabled"] == nil {
            let paramName = param["key"]!
            body += "--\(boundary)\r\n"
            body += "Content-Disposition:form-data; name=\"\(paramName)\""
            if param["contentType"] != nil {
              body += "\r\nContent-Type: \(param["contentType"] as! String)"
            }
            let paramType = param["type"] as! String
            if paramType == "text" {
              let paramValue = param["value"] as! String
              body += "\r\n\r\n\(paramValue)\r\n"
            } else {
                do {
                    let paramSrc = param["src"] as! String
                    let fileData = try NSData(contentsOfFile:paramSrc, options:[]) as Data
                    let fileContent = String(data: fileData, encoding: .utf8)!
                    body += "; filename=\"\(paramSrc)\"\r\n"
                      + "Content-Type: \"content-type header\"\r\n\r\n\(fileContent)\r\n"
                } catch  {
                }
            }
          }
        }
        body += "--\(boundary)--\r\n";
        let postData = body.data(using: .utf8)

        var request = URLRequest(url: URL(string: "http://116.196.107.117:50052/wayzoom/v1/vps/single")!,timeoutInterval: Double.infinity)
        request.addValue("multipart/form-data; boundary=\(boundary)", forHTTPHeaderField: "Content-Type")

        request.httpMethod = "POST"
        request.httpBody = postData

        let task = URLSession.shared.dataTask(with: request) { data, response, error in
          guard let data = data else {
            print(String(describing: error))
            semaphore.signal()
            return
          }
          print(String(data: data, encoding: .utf8)!)
          semaphore.signal()
        }

        task.resume()
        semaphore.wait()

    }
}
